function MSNVENOFig(num)% MSNVENOFig -- callback implementing functions of MSNVENODemoglobal MSNVENOFIGNUMMSNVENOInitif 1 <= num & num <= 11 ,    nihil = ~exist('MSNVENOFIGNUM');    if ~nihil,        empty = isempty(MSNVENOFIGNUM);    else        empty = 1;    end    if ~empty,        nil   = MSNVENOFIGNUM == 0;    else        nil   = 1;    end    if nil,        MSNVENOInit    end    figname = sprintf('MSNVENOFig%g',num);    clc; home; help(figname);    eval(figname);    RegisterPlot(figname,'{R}');    drawnow;    MSNVENOFIGNUM = num;elseif num==12,   % change default settings    clc; home    disp('There Are No Defaults to CHANGE');elseif num==20,   %run all figures    MSNVENOInit    for num=1:11,        figname = sprintf('aifig%g',num);        eval(figname);        RegisterPlot(figname,'{R}');        clc; home; help(figname);        drawnow;        MSNVENOFIGNUM = num;    endelse    disp('Bizarre argument in MSNVENOFig')    disp(sprintf('num =%g',num))end    %% Copyright (c) 2006. Victoria Stodden and David Donoho%  %% Part of SparseLab Version:100% Created Tuesday March 28, 2006% This is Copyrighted Material% For Copying permissions see COPYING.m% Comments? e-mail sparselab@stanford.edu%